import React from "react";

const TemperatureSlider = ({ temperature, handleSliderChange }) => {
  return (
    <div className="flex items-center">
      <p className="mr-2">Temperature: {temperature}</p>
      <input
        type="range"
        min="0"
        max="1"
        step="0.01"
        value={temperature}
        onChange={handleSliderChange}
        className="slider"
      />
    </div>
  );
};

export default TemperatureSlider;
